import LoginPage from './Screens/loginPage';
import {
  BrowserRouter as Router,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Route path='/register'>
        <LoginPage/>
      </Route>
    </Router>
  );
}

export default App;
